import React from 'react';
import Card from '../card';
import ArrDataOfCards from '../generate-data';
import './main.css';

export default class Main extends React.Component {

    readynewCards = () => {
        const amountOfCards = 5;
        const  newarr = ArrDataOfCards.slice(0, amountOfCards);
        return (
            newarr.map((item) => {
                console.log(item);
                return <Card data = {item}/>
            })
        )
    };
    render() {
        return (<div className="main">
                <h2 className="main__title">Каталог круизов</h2>
                <h3 className="main__subtitle">Сортировать круизы по <b className="main__filter">цене</b></h3>
                <div className="cards-container">{this.readynewCards()}
                </div>
                <button className="cards-list__show-more" onClick="">Показать больше</button>
                </div>
        )
    }
};
